#!/usr/bin/env python3

import logging
import os
from pwn import *

logging.disable()

HOST = os.environ.get("HOST", "printer.challs.jeopardy.ecsc2024.it")
PORT = int(os.environ.get("PORT", 47020))

r = remote(HOST, PORT)

r.recvuntil(b":")
r.sendline(b"")
r.recvuntil(b"ECSC{")
flag = b"ECSC{"+r.recvline(False)

print(flag.decode())
